import React from "react";
import './Page2.css';
import calendar from '../Images/calendar.png';

function Page2() {
  return (
    <div className="Page2">
      <div>
        <h1 className="headpage2">Change the way you build websites Forever.</h1>
        <p>In case you are starting a business or launching any product in the <br />
        market, Using the availbale pages you can quickly get started in a day <br />
        with your website. The desgin quality is polished very well, it looks very <br />
        professional.</p>
      </div>
      <div className="cal-container">
      <img 
          src={calendar} 
          alt="Image"
        />
      </div>
    </div>
  );
}

export default Page2;
